import React from "react";
import { NavLink, BrowserRouter, Route } from "react-router-dom";
import AddPatients from "../pages/AddPatients";
import SearchPatients from "../pages/SearchPatients";



const NavBar = () =>{
    return (
        <>
            <nav>
                <Routes>
                    <NavLink
                    to="/addPatients"
                    
                    
                    >
                        add
                    </NavLink>
                    <NavLink
                    to='/searchPatients'
                    
                    >
                        search
                    </NavLink>
                </Routes>
            </nav>
        </>
    )
}

export default NavBar;
